import React from "react";

function ExpenseStatistic(props) {
  const month = props.isMonth.map((value) => {
    return value.date.slice(5, 7);
  });
  console.log(month);
  const isOk = (a) => {
    for (var i = 0; i < month.length; i++) {
      if (a === month[i]) {
        return true;
      } else {
        return false;
      }
    }
  };

